import logo from "./logo.svg";
import "./App.css";
import { TextDisplay } from "./features/textDisplay/TextDisplay";
import { RandomColor } from "./features/randomColor/RandomColor";
import { InputArea } from "./features/inputArea/InputArea";
import { ToDoBoard } from "./features/todoList/ToDoBoard";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <TextDisplay />
        <RandomColor />
        <ToDoBoard />
      </header>
    </div>
  );
}

export default App;
